INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (8, 0, 16, "ヒヨリ", 2, "人助けが大好き！　前向き格闘娘", 100101, "A", "トゥインクルウィッシュ", "東山奈央", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 155, "獣人族", 44, 27, "人助け、応援");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (4, 0, 17, "ユイ", 2, "戦闘のサポートが得意な、心優しい少女", 100201, "O", "トゥインクルウィッシュ", "種田梨沙", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 158, "ヒューマン", 47, 5, "料理、人間観察");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (1, 0, 18, "レイ", 2, "クールで何事にも真っ直ぐな剣士", 100301, "B", "トゥインクルウィッシュ", "早見沙織", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 163, "魔族", 46, 12, "読書、乗馬、お茶");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (8, 0, 9, "ミソギ", 5, "探検好きのイタズラっ子", 100401, "O", "リトルリリカル", "諸星すみれ", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 128, "ヒューマン", 27, 10, "いたずら、探検");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (11, 0, 12, "マツリ", 8, "ヒーローに憧れる騎士見習いの少女", 100501, "O", "王宮騎士団（NIGHTMARE）", "下田麻美", "？？？", 146, "獣人族", 40, 25, "ヒーローごっこ");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (11, 0, 13, "アカリ", 7, "甘え上手なみんなの人気者", 100601, "O", "悪魔偽王国軍（ディアボロス）", "浅倉杏美", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 150, "魔族", 42, 22, "サックス");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (1, 0, 14, "ミヤコ", 7, "プリン大好きゴースト娘", 100701, "B", "悪魔偽王国軍（ディアボロス）", "雨宮天", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 130, "魔族", 32, 23, "プリンを食べること");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (10, 0, 14, "ユキ", 15, "ボクは誰よりも美しい", 100801, "AB", "ヴァイスフリューゲル　ランドソル支部", "大空直美", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 150, "エルフ", 40, 10, "鏡で自分を見ること");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (7, 0, 17, "アンナ", 13, "前世を信じる中二病患者、「疾風の冥姫」", 100901, "A", "トワイライトキャラバン", "髙野麻美", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 159, "魔族", 45, 5, "小説執筆");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (9, 0, 16, "マホ", 10, "マホマホ王国のプリンセス", 101001, "O", "自警団（カォン）", "内田真礼", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 155, "獣人族", 42, 22, "空想、ぬいぐるみ集め");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (8, 0, 15, "リノ", 3, "人懐っこくてマシンガントークな妹系少女", 101101, "A", "ラビリンス", "阿澄佳奈", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 156, "ヒューマン", 44, 25, "お裁縫");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (12, 0, 17, "ハツネ", 6, "みんなのために超能力を使う眠り姫", 101201, "A", "フォレスティエ", "大橋彩香", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 156, "エルフ", 46, 24, "妹と遊ぶこと、二度寝、昼寝、早寝");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (8, 0, 18, "ナナカ", 13, "オタク全開な魔法少女", 101301, "O", "トワイライトキャラバン", "佳村はるか", "", 166, "魔族", 55, 21, "読書、魔法");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (11, 0, 15, "カスミ", 10, "頭脳明晰な美少女名探偵", 101401, "AB", "自警団（カォン）", "水瀬いのり", "test", 152, "獣人族", 41, 3, "読書、推理");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (9, 0, 21, "ミサト", 6, "母性溢れる優しいみんなの「ミサト先生」", 101501, "O", "フォレスティエ", "國府田マリ子", "test", 165, "エルフ", 54, 5, "絵本作り");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (4, 0, 18, "スズナ", 14, "天真爛漫で人気者のカリスマモデル", 101601, "O", "ルーセント学院", "上坂すみれ", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 167, "魔族", 48, 10, "ファッション");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (7, 0, 19, "カオリ", 10, "いつでも「なんくるないさ～」な天然娘", 101701, "A", "自警団（カォン）", "高森奈津美", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 158, "獣人族", 53, 7, "踊り、空手");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (8, 0, 23, "イオ", 14, "多くの男性を魅了する無垢な女教師", 101801, "B", "ルーセント学院", "伊藤静", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 162, "魔族", 52, 14, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (4, 0, 10, "ミミ", 5, "お歌もにんじんも、ウサギさんも大好き♪", 102001, "O", "リトルリリカル", "日高里菜", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 117, "獣人族", 21, 3, "かわいいもの集め");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (6, 0, 12, "クルミ", 9, "泣き虫で臆病な守ってあげたい女の子", 102101, "B", "サレンディア救護院", "植田佳奈", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 150, "ヒューマン", 40, 9, "観劇、おままごと");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (11, 0, 13, "ヨリ", 7, "人見知りであまのじゃくな女の子", 102201, "O", "悪魔偽王国軍（ディアボロス）", "原紗友里", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 150, "魔族", 40, 22, "ゲーム全般");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (5, 0, 14, "アヤネ", 9, "ぷうきちといつも一緒！", 102301, "B", "サレンディア救護院", "芹澤優", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 148, "ヒューマン", 38, 10, "屋内でできる遊び");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (12, 0, 15, "スズメ", 9, "お嬢さまのためにがんばるドジっ娘メイド", 102501, "O", "サレンディア救護院", "悠木碧", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 154, "ヒューマン", 43, 12, "ご奉仕");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (1, 0, 17, "リン", 11, "遊びと睡眠が何より大事なぐうたら娘", 102601, "B", "牧場（エリザベスパーク）", "小岩井ことり", "test", 144, "獣人族", 42, 1, "あんパン");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (7, 0, 16, "エリコ", 13, "運命の相手に一途すぎる乙女", 102701, "B", "トワイライトキャラバン", "橋本ちなみ", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 154, "魔族", 43, 30, "実験、裁縫、料理");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (10, 0, 17, "サレン", 9, "救護院を経営する優しい庶民派お嬢様", 102801, "A", "サレンディア救護院", "堀江由衣", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 156, "エルフ", 43, 4, "経営、お茶会");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (1, 0, 17, "ノゾミ", 4, "歌って踊れる大人気アイドル", 102901, "B", "カルミナ", "日笠陽子", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 157, "ヒューマン", 40, 24, "舞台鑑賞、ダンス");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (8, 0, 16, "ニノン", 15, "トーゴクの神秘、オシエテクダサイ！", 103001, "O", "ヴァイスフリューゲル　ランドソル支部", "佐藤聡美", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 163, "ヒューマン", 51, 31, "忍法開発");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (12, 0, 18, "シノブ", 7, "占いが得意な霊能少女", 103101, "AB", "悪魔偽王国軍（ディアボロス）", "大坪由佳", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 157, "魔族", 42, 22, "占い");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, 0, 18, "アキノ", 12, "一人前の商人を目指すパワフルお嬢様", 103201, "AB", "メルクリウス財団", "松嵜麗", "この私とともにいる限り、\nお金に不自由はさせませんわ！", 157, "ヒューマン", 45, 12, "慈善事業");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, 0, 20, "マヒル", 11, "みんなを笑顔にするお笑い牧場主", 103301, "B", "牧場（エリザベスパーク）", "新田恵海", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 142, "ヒューマン", 35, 3, "漫才");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, 0, 22, "ユカリ", 12, "純情でほっとけない大人の女性", 103401, "A", "メルクリウス財団", "今井麻美", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 164, "エルフ", 55, 16, "ウインドーショッピング");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (2, 0, 8, "キョウカ", 5, "礼儀正しくしっかり者のちびっ子優等生", 103601, "A", "リトルリリカル", "小倉唯", "test", 118, "エルフ", 21, 2, "お勉強");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (8, 0, 13, "トモ", 8, "義理堅くてからかい好きな剣術少女", 103701, "A", "王宮騎士団（NIGHTMARE）", "茅原実里", "test", 149, "ヒューマン", 43, 11, "剣術、年長者をからかう");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (11, 0, 14, "シオリ", 11, "読書が趣味の病弱少女", 103801, "A", "牧場（エリザベスパーク）", "小清水亜美", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 153, "獣人族", 40, 3, "読書、お散歩");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (6, 0, 13, "アオイ", 6, "「友達」に憧れる、エルフの森の女の子", 104001, "AB", "フォレスティエ", "花澤香菜", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 158, "エルフ", 44, 6, "友達作りのイメトレ");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (6, 0, 17, "チカ", 4, "人々を守るために歌う、唱喚士の少女", 104201, "O", "カルミナ", "福原綾香", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 163, "ヒューマン", 46, 3, "各種楽器");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (8, 0, 17, "マコト", 10, "男勝りで情に厚いワイルド娘", 104301, "O", "自警団（カォン）", "小松未可子", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 168, "獣人族", 54, 9, "お菓子作り");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (5, 0, "??", "イリヤ", 7, "かつては夜を支配した最強の吸血鬼", 104401, "A", "悪魔偽王国軍（ディアボロス）", "丹下桜", "test", 172, "魔族", 50, 5, "世界征服");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (11, 0, 18, "クウカ", 15, "妄想大好き！　ほんとは照れ屋な女の子", 104501, "AB", "ヴァイスフリューゲル　ランドソル支部", "長妻樹里", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 157, "ヒューマン", 49, 19, "小説を読むこと");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, 0, 18, "タマキ", 12, "弱きを助け強きをくじく猫娘", 104601, "AB", "メルクリウス財団", "沼倉愛美", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 158, "獣人族", 48, 1, "猫とたわむれること");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (10, 0, 25, "ジュン", 8, "素顔を見せない冷静沈着な女性騎士", 104701, "A", "王宮騎士団（NIGHTMARE）", "川澄綾子", "？？？", 171, "ヒューマン", 50, 25, "格闘技、湯浴み");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (11, 0, 20, "ミフユ", 12, "仕事も私事も効率優先な傭兵少女", 104801, "O", "メルクリウス財団", "田所あずさ", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 163, "ヒューマン", 49, 11, "傭兵などのアルバイト");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (10, 0, 18, "シズル", 3, "お姉ちゃんがお世話してあげるからねっ！", 104901, "O", "ラビリンス", "生天目仁美", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 168, "ヒューマン", 54, 24, "家事全般");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (1, 0, 11, "ミサキ", 14, "ちょっとおませな恋に恋する女の子", 105001, "A", "ルーセント学院", "久野美咲", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 120, "魔族", 22, 3, "ファッション誌鑑賞、コスメ集め");
