INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (6, 0, 17, "チカ（クリスマス）", 4, "人々を守るために歌う、唱喚士の少女", 108401, "O", "カルミナ", "福原綾香", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 163, "ヒューマン", 46, 3, "各種楽器");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (6, 0, 12, "クルミ（クリスマス）", 9, "泣き虫で臆病な守ってあげたい女の子", 108501, "B", "サレンディア救護院", "植田佳奈", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 150, "ヒューマン", 40, 9, "観劇、おままごと");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (5, 0, 14, "アヤネ（クリスマス）", 9, "ぷうきちといつも一緒！", 108601, "B", "サレンディア救護院", "芹澤優", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 148, "ヒューマン", 38, 10, "屋内でできる遊び");
