INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (12, 0, 17, "アン", "", "英霊と契約を結んだマナリアの天才王女", 109201, "AB", "？？？", "日笠陽子", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 156, "ヒューマン", 55, 1, "読書");
